import React, { Component, Fragment } from 'react'
import Cards from '../Components/Cards/Cards'

export default class Homepage extends Component {
    constructor() {
        super();
        this.state = {
            value: 'Welcome to react'
        }
    }
  render() {
    return (
        <Fragment>
        <p>{this.state.value}</p>
        <div className='heading_source'>
            <Cards />
        </div>
      </Fragment>
    )
  }
}
